import { useNavigate } from "react-router-dom";
import css from "./styled.module.css";
import { Button } from "react-bootstrap";
import { useEffect, useState } from "react";
import axios from "axios";

const Cadastro = () => {
    const [ typeCadastro, setTypeCadastro ] = useState(null);

    const [ clientName, setClientName ] = useState("");
    const [ clientEmail, setClientEmail ] = useState("");
    const [ clientPassword, setClientPassword ] = useState("");
    const [ clientConfirmPassword, setClientConfirmPassword ] = useState("");
    const [ clientFormStatus, setClientFormStatus ] = useState();
    const [ clientForm, setClientForm ] = useState({
        name: null,
        email: null,
        password: null,
    });

    const [ storeName, setStoreName ] = useState("");
    const [ storetEmail, setStoreEmail ] = useState("");
    const [ storePassword, setStorePassword ] = useState("");
    const [ storeConfirmPassword, setStoreConfirmPassword ] = useState("");
    const [ storeFormStatus, setStoreFormStatus ] = useState(false);
    const [ storeForm, setStoreForm ] = useState({
        name: null,
        email: null,
        password: null,
    });

    const navigate = useNavigate();

    // useEffect(() => {
    //     axios.post("https://localhost:7221/api/Client/create", {
    //         clientFormStatus
    //     })
    //     .then(() => alert("foi"))
    // }, [clientFormStatus])

    const typeCadastroOption = [
        "Client",
        "Store"
    ];

    const postFormClient = () => {
        validateName(clientForm.name);
        validateEmail(clientForm.email);
    };

    const validateName = (name) => {
        if(name.length > 2){
            return true;
        } else return false;
    };

    const validateEmail = (email) => {
        let regex = /^([a-z]){1,}([a-z0-9._-]){1,}([@]){1}([a-z]){2,}([.]){1}([a-z]){2,}([.]?){1}([a-z]?){2,}$/i;
        
        return regex.test(email)
    };

    const validatePassword = () => {
    };

    return(
        <>
           {typeCadastro == null ? (
                <section className={css.container_login}>
                    <div className={css.container_select_type}>
                        <h1>Faça seu cadastro</h1>
                        <p>Escolha o tipo da sua conta:</p>
                        <div>
                            <button onClick={e => setTypeCadastro(typeCadastroOption[0])}>Cliente</button>
                            <button onClick={e => setTypeCadastro(typeCadastroOption[1])}>Loja</button>
                        </div>
                    </div>
                </section>
           ) : (
            <section className={css.container_login}>
                <div className={css.card_login}>
                    <h1>Faça seu cadastro</h1>
                    {typeCadastro === "Client" && (
                        <div className={css.container_form}>
                            <label htmlFor="nameclient">Nome:</label>
                            <input 
                                type="text"
                                id="nameclient"
                                onChange={e => setClientForm({...clientForm, name: e.target.value})}
                                value={clientForm.name}
                            />

                            <label htmlFor="emailclient">Email:</label>
                            <input 
                                type="email"
                                id="emailclient"
                                onChange={e => setClientForm({...clientForm, email: e.target.value})}
                                value={clientForm.email}
                            />
                            
                            <label htmlFor="passwordclient">Senha:</label>
                            <input
                                type="password"
                                id="passwordclient"
                                onChange={e => setClientForm({...clientForm, password: e.target.value})}
                                value={clientForm.password}
                            />

                            <label htmlFor="confirmpasswordclient">Confirme a senha:</label>
                            <input 
                                type="password"
                                id="confirmpasswordclient"
                            />
                        </div>
                    )}

                    {typeCadastro === "Store" && (
                        <div className={css.container_form}>
                            <label htmlFor="name">Nome:</label>
                            <input 
                                type="text"
                                id="name"
                                onChange={e => setStoreName(e.target.value)}
                                value={storeName}
                            />

                            <label htmlFor="email">Email:</label>
                            <input 
                                type="text"
                                id="email"
                            />
                            
                            <label htmlFor="password">Senha:</label>
                            <input
                                type="password"
                                id="password"
                            />

                            <label htmlFor="confirm-password">Confirme a senha:</label>
                            <input 
                                type="password"
                                id="confirm-password"
                            />
                        </div>
                    )}
                    <div>
                        <Button onClick={() => postFormClient()} variant="primary">Cadastrar</Button>
                    </div>
                </div>
            </section>
        )}
        </>
    )
}

export default Cadastro;
